import React from 'react';
import { useState } from 'react';
import styled from 'styled-components';
import ListPage from './Listpage';
import FilterComponent from './FilterComponent';
import { Link } from 'react-router-dom';
import modalStyles from './ModalStyle'; // 스타일 파일 import

// // 공통 스타일을 정의한 styled-components
const StyledDiv = styled.div`
padding-left: 15px; /* padding 추가 */
padding-right: 15px; /* padding 추가 */
`;

const Header = styled.header`
background-color: #488AEE;
// padding: 5px;
height: 130px;
text-align: center;
justify-content: center;
`;

const Logoimg = styled.img`
// padding: 10px;
height: 110px;
text-align: center;
display: inline-block;
cursor: pointer; /* 커서를 포인터로 변경하여 클릭 가능하게 함 */
`;

const Linkdiv = styled.div`
background-color: #488AEE;
text-decoration: none;
color: inherit;
text-align: right;
transition: background-color 0.3s ease-in-out;
`;

const StyledButton = styled.button`
text-decoration: none;
color: inherit;
background-color: lightGray;
padding: 5px 10px;
margin-right: 15px;
margin-top: 10px;
border: none; /* 테두리 제거 */
border-radius: 13px;
display: inline-block;
cursor: pointer;
transition: background-color 0.3s ease-in-out;

font-size: 13px; /* 글자 크기 지정 */
font-weight: 400; /* 글자 두께 지정 */
`;






const data = [
    { id: 1, title: '품목 1', date: '2023-11-13' },
    { id: 2, title: '품목 2', date: '2023-11-14' },
    { id: 3, title: '품목 3', date: '2023-11-15' },
    { id: 4, title: '품목 4', date: '2023-11-16' },
    { id: 5, title: '품목 5', date: '2023-11-17' },
    { id: 6, title: '품목 6', date: '2023-11-18' },
    { id: 1, title: '품목 1', date: '2023-11-13' },
    { id: 2, title: '품목 2', date: '2023-11-14' },
    { id: 3, title: '품목 3', date: '2023-11-15' },
    { id: 4, title: '품목 4', date: '2023-11-16' },
    { id: 5, title: '품목 5', date: '2023-11-17' },
    { id: 6, title: '품목 6', date: '2023-11-18' },
    { id: 1, title: '품목 1', date: '2023-11-13' },
    { id: 2, title: '품목 2', date: '2023-11-14' },
    { id: 3, title: '품목 3', date: '2023-11-15' },
    { id: 4, title: '품목 4', date: '2023-11-16' },
    { id: 5, title: '품목 5', date: '2023-11-17' },
    { id: 6, title: '품목 8', date: '2023-11-18' },

  ];

const PartyAllList= () => {

    

    const [currentPage, setCurrentPage] = useState(1);
    const itemsPerPage = 4;
    const totalPages = Math.ceil(data.length / itemsPerPage);

    
    const handleClick = (page) => {
        setCurrentPage(page);
    };


        const handlePrevClick = () => {
            setCurrentPage((prev) => prev - 1);
        };

        const handleNextClick = () => {
            setCurrentPage((prev) => prev + 1);
        };

        const startIndex = (currentPage - 1) * itemsPerPage;
        const endIndex = startIndex + itemsPerPage;
        const currentItems = data.slice(startIndex, endIndex);


    return (
    <div>
        <h2 style={{display:'flex',justifyContent:'center'}}>2023 부산 광안리 불꽃 축제</h2>

        <div>

            <Linkdiv>
                <StyledButton>로그아웃</StyledButton>
                </Linkdiv>
            <Header>
            <Link to="/."> {/* 메인화면으로 이동 */}
                <Logoimg src="info.png" alt="Logo" />
            </Link>
                <Headerlist>
                
                <MyLink to ="/festival-list">축제 목록</MyLink>
                <MyLink to ="/party-list">전체 파티 목록</MyLink>
                <MyLink to ="/my-party-list">내 파티</MyLink>
                </Headerlist>
            </Header>


            <FilterComponent />
            
            <br></br><br></br><br></br><br></br><br></br><br></br>
            <ListPage/>
                <div style={{marginBottom: '20px', position: 'fixed', bottom: 0, display: 'flex', justifyContent: 'center', width: '100%' }}>
                    <div style={{ display: 'flex' }}>
                        <button onClick={handlePrevClick} disabled={currentPage === 1}>
                            {'<'}
                        </button>
                        {Array.from({ length: totalPages }, (_, index) => index + 1).map(
                            (page) => (
                                <button
                                key={page}
                                onClick={() => handleClick(page)}
                                disabled={page === currentPage}
                                style={{ margin: '0 10px', color: page === currentPage ? '#488AEE' : 'black' }}
                            >
                                {page}
                            </button>
                            )
                        )}
                        <button onClick={handleNextClick} disabled={currentPage === totalPages}>
                            {'>'}
                        </button>
                    </div>
                </div>
            </div>
    </div>
    
    );
};

export default PartyAllList;
